import React from "react";
import INTROVIDEO from "../../assets/img/intro-video.png";
import "./style.scss";

function Intro() {
  return (
    <div className="intro">
      <div className="intro-back">
        <div className="intro-back-white"></div>
        <div className="intro-back-black"></div>
      </div>
      <div className="intro-container">
        <img src={INTROVIDEO} alt="introvideo"></img>
        <div className="intro-container-button">
          <div className="intro-container-button-title">
            Please choose who you are?
          </div>
          <div className="intro-container-button-group">
            <div className="intro-container-button-group-sta">
              <p>I`m Fashionista</p>
            </div>
            <div className="intro-container-button-group-seek">
              I`m Fashion Seeker
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Intro;
